import{_ as a,a as r,b as s,c as t,d as i,e,f as o,g as l,h as n,i as p,j as h,k as c,l as m,m as d,n as _,o as g,p as k,q as b,r as x,s as u,t as f,u as D,v as M,w}from"./streamDockProfile-CaILKSL2.js";import{_ as v,c as S,o as q,b as P}from"./app-CIS_Vh5O.js";const C={},y=P('<h1 id="streamdock系列问题" tabindex="-1"><a class="header-anchor" href="#streamdock系列问题"><span><strong>streamDock系列问题</strong></span></a></h1><h2 id="mirabox-—-固件更新" tabindex="-1"><a class="header-anchor" href="#mirabox-—-固件更新"><span>Mirabox — 固件更新</span></a></h2><p>固件更新为 Stream Dock 提供最新的改进和错误修复。</p><p><strong>注意：</strong> 执行固件更新时，确保更新不中断至关重要。更新时，请确保满足以下条件：</p><ul><li><strong>⚠️ 请勿关闭计算机。</strong></li><li><strong>⚠️ 请勿断开 Stream Dock。</strong></li><li><strong>⚠️ 请勿关闭或退出 Stream Dock 应用程序。</strong></li></ul><hr><h3 id="_1-固件更新步骤" tabindex="-1"><a class="header-anchor" href="#_1-固件更新步骤"><span>1. 固件更新步骤</span></a></h3><hr><p>1） 确保已安装最新的 Stream Dock 软件</p><ul><li>检查 Stream Dock 软件中的更新</li><li>从 <a href="https://miraboxdemo.key123.vip/downloads" target="_blank" rel="noopener noreferrer">https://miraboxdemo.key123.vip/downloads</a> 下载最新版本</li></ul><img src="'+a+'" alt="Mirabox" width="100%"><p>2） 通过单击软件左上角商店按钮旁边的设置齿轮打开设置。</p><img src="'+r+'" alt="Mirabox"><p>3） 单击 <strong>“更新固件”</strong> 来进行更新。请勿在固件更新过程中断开 Stream Dock 的连接或关闭计算机。在设备重启的更新过程中，设备的按键可能会闪烁。</p><img src="'+s+'" alt="Mirabox" width="100%"><p>4） 等到更新完成，然后像往常一样使用 Stream Dock。</p><img src="'+t+'" alt="Mirabox" width="100%"><h2 id="如何将开发好的插件或其他产品集合到stream-dock中运行" tabindex="-1"><a class="header-anchor" href="#如何将开发好的插件或其他产品集合到stream-dock中运行"><span>如何将开发好的插件或其他产品集合到stream Dock中运行</span></a></h2><p>许多用户开发好了专署产品却不知道如何将其放到StreamDock中运行自己的产品，这对于这个问题在这里将进行详细分步骤讲解</p><p><em>当您借组开发文档SDK开发好了您的专署产品，可以将打包好的文件夹放到plugin文件夹中，重启软件即可</em></p><hr><h3 id="_1-个人开发好的产品集合到软件运行的具体步骤" tabindex="-1"><a class="header-anchor" href="#_1-个人开发好的产品集合到软件运行的具体步骤"><span>1. 个人开发好的产品集合到软件运行的具体步骤</span></a></h3><p>1）打开软件点击左上角设置按钮</p><img src="'+r+'" alt="Mirabox"><hr><p>2）选择弹出框的头部导航<strong>通用</strong>选项，并点击<strong>打开应用文件夹</strong></p><img src="'+i+'" alt="Mirabox" width="100%"><hr><p>3）之后会弹出一个文件交互页面，找到相应开发产品类型的文件夹，插件对应的是plugins，图标库对应的是icons</p><p><em>软件的产品存储路径默认是 C:\\Users\\OptiPlex\\AppData\\Roaming\\HotSpot\\StreamDock</em></p><p><em><strong>⚠️ 警示：请不要修改文件存储路径，因为这可能会导致stream Dock软件无法正常运行</strong></em></p><img src="'+e+'" alt="Mirabox" width="100%"><hr><p><strong>4）将开发好的产品文件夹放到相应产品类型目录下，这里以plugin为例</strong></p><p><em><strong>⚠️ 注意：文件命名必须是反域名命名格式，用于标识软件包或应用程序的唯一性</strong></em></p><p>例：com.mirabox.streamdock.calendar.sdPlugin</p><ul><li><p><strong>com</strong>: 这通常是指公司或组织的域名的顶级域名（TLD）。在这里，&quot;com&quot; 表示商业组织（commercial），通常用于商业目的的软件包命名。</p></li><li><p><strong>mirabox</strong>: 这是公司或组织的名称或者域名的一部分。它可以是公司名、品牌名或者域名的一部分。</p></li><li><p><strong>streamdock</strong>: 这是产品或服务的名称，即对应软件名称。</p></li><li><p><strong>calendar</strong>: 您所开发的产品的名称。</p></li><li><p><strong>sdPlugin</strong>: 这标识您的产品为插件类型（plugin）。</p></li><li><p><strong>sdIconPack</strong>: 这标识您的产品为图标类型 (icon)。</p></li></ul><img src="'+o+'" alt="Mirabox" width="100%"><hr><h2 id="某些设备在软件中无法显示的问题" tabindex="-1"><a class="header-anchor" href="#某些设备在软件中无法显示的问题"><span>某些设备在软件中无法显示的问题</span></a></h2><p><strong>当您下载并完成 Steam Dock 软件安装，部分设备型无法一次性行展示所有设备的列表</strong></p><p><em>某些版本型号会存在这个现象，这可能是针对每个不同版本软件的具体设计</em></p><img src="'+l+'" alt="Mirabox" width="100%"><p><strong>解决方式：</strong></p><p>1）尝试重启软件</p><p>2）点击重置数据</p><img src="'+n+'" alt="Mirabox" width="100%"><p>3）连接到相应硬件设备后重启重启软件</p><img src="'+p+'" alt="Mirabox" width="100%"><ul><li>使用以上方法如仍无法解决，或存在其他任何疑惑，可以随时<a href="https://bbs.key123.vip/#/" target="_blank" rel="noopener noreferrer">联系我们</a></li></ul><h2 id="如何正确使用场景模块" tabindex="-1"><a class="header-anchor" href="#如何正确使用场景模块"><span>如何正确使用场景模块</span></a></h2><h3 id="_1-场景简介" tabindex="-1"><a class="header-anchor" href="#_1-场景简介"><span>1. 场景简介</span></a></h3><p>场景的出现让stream Dock的可用性和便捷性大大提升，用户的体验感受有了质的的飞跃。</p><p><strong>stream Dock可以有多个场景</strong>，对此用户可以自定义自己的专属场景，包括场景的增加、删除、设计、导入、导出、命名等；场景之间可以来回切换，这对于Stream Dock的重度使用者非常友好。</p><h3 id="_2-最新场景" tabindex="-1"><a class="header-anchor" href="#_2-最新场景"><span>2. 最新场景</span></a></h3><p>在最新的Stream Dock 2.10.179.426 版本中默认内置了四个场景，分别是 Windos控制场景、常用网站场景、信息看板场景、音乐控制太场景</p><ul><li><strong>Windows控制场景</strong></li></ul><img src="'+h+'" alt="Mirabox" width="100%"><hr><ul><li><strong>常用网站场景</strong></li></ul><img src="'+c+'" alt="Mirabox" width="100%"><hr><ul><li><strong>信息看板场景</strong></li></ul><img src="'+m+'" alt="Mirabox" width="100%"><hr><ul><li><strong>音乐控制太场景</strong></li></ul><img src="'+d+'" alt="Mirabox" width="100%"><h3 id="_3-新增场景" tabindex="-1"><a class="header-anchor" href="#_3-新增场景"><span>3. 新增场景</span></a></h3><p>1）在场景列表区域或设置页面中点击添加图标便可创建一个新的场景</p><img src="'+_+'" alt="Mirabox" width="100%"><p>2）新增场景后用户遍可以根据自己喜好随意设计专属场景</p><img src="'+g+'" alt="Mirabox" width="100%"><h3 id="_4-删除场景" tabindex="-1"><a class="header-anchor" href="#_4-删除场景"><span>4. 删除场景</span></a></h3><p>选中需要删除的场景后，在场景列表区域或设置页面中点击删除图标便可删除当前选中的场景删除，也可以在设置页面中直接右键场景选择删除</p><img src="'+k+'" alt="Mirabox" width="100%"><img src="'+b+'" alt="Mirabox" width="100%"><h3 id="_5-场景重命名" tabindex="-1"><a class="header-anchor" href="#_5-场景重命名"><span>5. 场景重命名</span></a></h3><p>双击或右击场景便可进行重命名</p><img src="'+x+'" alt="Mirabox"><h3 id="_6-场景自动切换" tabindex="-1"><a class="header-anchor" href="#_6-场景自动切换"><span>6. 场景自动切换</span></a></h3><p>场景的自动切换功能对于许多用户来说，知名度并不高；但如果您了解到此功能，它的实用性将会非常大，也许你将会对它爱不释手。</p><p>自动切换的作用：当您给某个场景选中对应的应用程序后，以后在你使用改应用程序时，stream Dock将会自动切换到该场景</p><p><strong>尝试一下:</strong></p><p>1）这里以将选中Chrome应用程序绑定到我的场景中,绑定后将在场景对应列表项右边显示程序图标</p><img src="'+u+'" alt="Mirabox" width="100%"><hr><img src="'+f+'" alt="Mirabox" width="100%"><p>2）切换到其他场景</p><p>3）打开Chrome后，重新切回Stream Dock 将会自动选中Chrome所绑定的场景</p><img src="'+D+'" alt="Mirabox" width="100%"><h3 id="_7-场景的导入导出" tabindex="-1"><a class="header-anchor" href="#_7-场景的导入导出"><span>7. 场景的导入导出</span></a></h3><p>当您设计了一套适合的场景想要保存起来，或者想将改场景分享给朋友在其他电脑上使用，可以使用导入导出功能</p><img src="'+M+'" alt="Mirabox" width="100%"><p>可以将设计好的场景一件导出，以文件的形式存在本地中,保存格式是.streamDockProfile的二进制文件，导入也选中相应格式的文件导入便可</p><img src="'+w+'" alt="Mirabox" width="100%">',95),z=[y];function N(B,O){return q(),S("div",null,z)}const W=v(C,[["render",N],["__file","streamDock.html.vue"]]),j=JSON.parse('{"path":"/zh/faqs/streamDock.html","title":"streamDock系列问题","lang":"zh-CN","frontmatter":{"title":"streamDock系列问题"},"headers":[{"level":2,"title":"Mirabox — 固件更新","slug":"mirabox-—-固件更新","link":"#mirabox-—-固件更新","children":[{"level":3,"title":"1. 固件更新步骤","slug":"_1-固件更新步骤","link":"#_1-固件更新步骤","children":[]}]},{"level":2,"title":"如何将开发好的插件或其他产品集合到stream Dock中运行","slug":"如何将开发好的插件或其他产品集合到stream-dock中运行","link":"#如何将开发好的插件或其他产品集合到stream-dock中运行","children":[{"level":3,"title":"1. 个人开发好的产品集合到软件运行的具体步骤","slug":"_1-个人开发好的产品集合到软件运行的具体步骤","link":"#_1-个人开发好的产品集合到软件运行的具体步骤","children":[]}]},{"level":2,"title":"某些设备在软件中无法显示的问题","slug":"某些设备在软件中无法显示的问题","link":"#某些设备在软件中无法显示的问题","children":[]},{"level":2,"title":"如何正确使用场景模块","slug":"如何正确使用场景模块","link":"#如何正确使用场景模块","children":[{"level":3,"title":"1. 场景简介","slug":"_1-场景简介","link":"#_1-场景简介","children":[]},{"level":3,"title":"2. 最新场景","slug":"_2-最新场景","link":"#_2-最新场景","children":[]},{"level":3,"title":"3. 新增场景","slug":"_3-新增场景","link":"#_3-新增场景","children":[]},{"level":3,"title":"4. 删除场景","slug":"_4-删除场景","link":"#_4-删除场景","children":[]},{"level":3,"title":"5. 场景重命名","slug":"_5-场景重命名","link":"#_5-场景重命名","children":[]},{"level":3,"title":"6. 场景自动切换","slug":"_6-场景自动切换","link":"#_6-场景自动切换","children":[]},{"level":3,"title":"7. 场景的导入导出","slug":"_7-场景的导入导出","link":"#_7-场景的导入导出","children":[]}]}],"git":{"updatedTime":1721807957000,"contributors":[{"name":"xiaosi","email":"512282129@qq.com","commits":1}]},"filePathRelative":"zh/faqs/streamDock.md"}');export{W as comp,j as data};
